      <header className='App-header'>
        <img src={logo} className='App-logo' alt='logo' />
        <p>
          <Greetings firstName='Dashulik' lastName='Smotrova' />
          Not Edit <code>src/App.js</code> and save to reload. I like it
        </p>
      </header>
    </div>
  );

export default App;
